const ulStyle = {
  marginTop: "20px",
  textAlign: "right",
};
const liStyle = {
  display: "inline-block",
  paddingLeft: "20px",
};
const aStyle = {
  fontWeight: 500,
};

export default {
  liStyle,
  ulStyle,
  aStyle,
};
